    t[205] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u0432\u0430\u0448 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e \u0432 \u044f\u043a\u043e\u0441\u0442\u0456 HTTP-\u043f\u0440\u043e\u043a\u0441\u0456 \u0430\u0431\u043e \u0434\u0430\u0439\u0442\u0435 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u043c\u0456\u043d\u043d\u0456\u0439 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0430 \"http_proxy\" \u0434\u043b\u044f \u043a\u043e\u043d\u0441\u043e\u043b\u044c\u043d\u0438\u0445 \u043f\u0440\u043e\u0433\u0440\u0430\u043c \u0443 GNU/Linux.";
    t[206] = "Stopped";
    t[207] = "\u0417\u0443\u043f\u0438\u043d\u0435\u043d\u043e";
    t[208] = "hop variance";
    t[209] = "\u0445\u043e\u043f \u0440\u043e\u0437\u0431\u0456\u0436\u043d\u0456\u0441\u0442\u044c";
    t[210] = "Backup Count";
    t[211] = "\u0420\u0435\u0437\u0435\u0440\u0432\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c";
    t[212] = "Configuration";
    t[213] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f";
    t[216] = "Use unique IP addresses for each connecting client (local non-SSL servers only)";
    t[217] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u0443\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u0456 IP-\u0430\u0434\u0440\u0435\u0441\u0438 \u0434\u043b\u044f \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u043a\u043b\u0456\u0454\u043d\u0442\u0430, \u0449\u043e \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0454\u0442\u044c\u0441\u044f (\u043b\u0438\u0448\u0435 \u0434\u043b\u044f \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0445 \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432 \u0431\u0435\u0437 SSL)";
    t[222] = "Start this Tunnel";
    t[223] = "\u0417\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0446\u0435\u0439 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[228] = "This could be the full Base64 destination key, or an I2P URL from your address book.";
    t[229] = "\u0426\u0435 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043f\u043e\u0432\u043d\u0438\u0439 \u043a\u043b\u044e\u0447 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f Base64 \u0430\u0431\u043e URL-\u0430\u0434\u0440\u0435\u0441\u0430 I2P \u0456\u0437 \u0432\u0430\u0448\u043e\u0457 \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438.";
    t[230] = "List of helper URLs providing jump links when a host is not found in your addressbook";
    t[231] = "\u0421\u043f\u0438\u0441\u043e\u043a \u0434\u043e\u043f\u043e\u043c\u0456\u0436\u043d\u0438\u0445 URL-\u0430\u0434\u0440\u0435\u0441, \u044f\u043a\u0456 \u043d\u0430\u0434\u0430\u044e\u0442\u044c \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0443, \u043a\u043e\u043b\u0438 \u0445\u043e\u0441\u0442 \u043d\u0435 \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043e \u0443 \u0432\u0430\u0448\u0456\u0439 \u0430\u0434\u0440\u0435\u0441\u043d\u0456\u0439 \u043a\u043d\u0438\u0437\u0456";
    t[234] = "+ 0-3 hop variance";
    t[235] = "\u0434\u0438\u0441\u043f\u0435\u0440\u0441\u0456\u044f \u0441\u0442\u0440\u0438\u0431\u043a\u0456\u0432 0-3";
    t[236] = "Note: These custom headers will only be enabled for served files that don't have the relevant header already set.";
    t[237] = "\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430. \u0426\u0456 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u044c\u043d\u0456 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0438 \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u0456 \u043b\u0438\u0448\u0435 \u0434\u043b\u044f \u043f\u043e\u0434\u0430\u043d\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432, \u044f\u043a\u0456 \u043d\u0435 \u043c\u0430\u044e\u0442\u044c \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u043e\u0433\u043e \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0430.";
    t[238] = "Encryption types";
    t[239] = "\u0422\u0438\u043f\u0438 \u0448\u0438\u0444\u0440\u0443\u0432\u0430\u043d\u043d\u044f";
    t[240] = "A server tunnel that is customised for HTTP connections.";
    t[241] = "\u0421\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0434\u043b\u044f HTTP \u0437\u2019\u0454\u0434\u043d\u0430\u043d\u044c.";
    t[242] = "Use SSL";
    t[243] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 SSL";
    t[246] = "Destination signing key is not available. Start the tunnel.";
    t[247] = "\u041a\u043b\u044e\u0447 \u043f\u0456\u0434\u043f\u0438\u0441\u0443 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439. \u0417\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[248] = "Maximum number of web page requests per minute for a unique client before access to the server is blocked";
    t[249] = "\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u0432\u0435\u0431-\u0441\u0442\u043e\u0440\u0456\u043d\u043e\u043a \u0437\u0430 \u0445\u0432\u0438\u043b\u0438\u043d\u0443 \u0434\u043b\u044f \u0443\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u043b\u0456\u0454\u043d\u0442\u0430, \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0431\u0443\u0434\u0435 \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u043e";
    t[266] = "Edit Server Tunnel Settings for";
    t[267] = "\u0420\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e \u0434\u043b\u044f";
    t[268] = "Share tunnels with other configured clients";
    t[269] = "\u0421\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u043c\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c\u0438";
    t[274] = "required";
    t[275] = "\u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e";
    t[282] = "Optimize for Multihoming";
    t[283] = "\u041e\u043f\u0442\u0438\u043c\u0456\u0437\u0443\u0432\u0430\u0442\u0438 \u0434\u043b\u044f \u043c\u043d\u043e\u0436\u0438\u043d\u043d\u043e\u0457 \u0430\u0434\u0440\u0435\u0441\u0430\u0446\u0456\u0457";
    t[288] = "Local destination";
    t[289] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0439 \u0430\u0434\u0440\u0435\u0441 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[292] = "Reduced tunnel count";
    t[293] = "\u0417\u043c\u0435\u043d\u0448\u0435\u043d\u043d\u044f \u0447\u0438\u0441\u043b\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[300] = "+ 0-2 hop variance";
    t[301] = "\u0434\u0438\u0441\u043f\u0435\u0440\u0441\u0456\u044f \u0441\u0442\u0440\u0438\u0431\u043a\u0456\u0432 0-2";
    t[302] = "Alt Base32";
    t[303] = "\u0410\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0430 \u0431\u0430\u0437\u0430 32";
    t[304] = "Port";
    t[305] = "\u041f\u043e\u0440\u0442";
    t[318] = "Per Day";
    t[319] = "\u0417\u0430 \u0434\u0435\u043d\u044c";
    t[326] = "IRC networks outside I2P can also be reached if a SOCKS outproxy within I2P is known, though it depends on whether or not the outproxy has been blocked by the IRC network.";
    t[327] = "IRC-\u043c\u0435\u0440\u0435\u0436\u0456 \u043f\u043e\u0437\u0430 I2P \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456, \u044f\u043a\u0449\u043e \u0432\u0456\u0434\u043e\u043c\u0438\u0439 SOCKS outproxy \u0432 I2P, \u0430\u043b\u0435 \u0446\u0435 \u0437\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0432\u0456\u0434 \u0442\u043e\u0433\u043e, \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u0447\u0438 \u043d\u0456 outproxy IRC-\u043c\u0435\u0440\u0435\u0436\u0435\u044e.";
    t[330] = "Specify the .i2p address or destination (b32 or b64) of the tunnel here.";
    t[331] = "\u0412\u043a\u0430\u0436\u0456\u0442\u044c \u0442\u0443\u0442 \u0430\u0434\u0440\u0435\u0441\u0443 .i2p \u0430\u0431\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f (b32 \u0430\u0431\u043e b64) \u0442\u0443\u043d\u0435\u043b\u044e.";
    t[332] = "Invalid address";
    t[333] = "\u041d\u0435\u0432\u0456\u0440\u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0430";
    t[334] = "This tunnel must be configured with the new subdomain and destination.";
    t[335] = "\u0426\u0435\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u043c\u0430\u0454 \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0437 \u043d\u043e\u0432\u0438\u043c \u0441\u0443\u0431\u0434\u043e\u043c\u0435\u043d\u043e\u043c \u0456 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f\u043c.";
    t[342] = "Close tunnels when idle";
    t[343] = "\u0417\u0430\u043a\u0440\u0438\u0432\u0430\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u0456 \u043f\u0440\u0438 \u043f\u0440\u043e\u0441\u0442\u043e\u044e";
    t[346] = "Next";
    t[347] = "\u0414\u0430\u043b\u0456";
    t[348] = "The first thing to decide is whether you want to create a server or a client tunnel.";
    t[349] = "\u0421\u043f\u0435\u0440\u0448\u0443 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432\u0438\u0440\u0456\u0448\u0438\u0442\u0438, \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0447\u0438 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438.";
    t[350] = "Set the Referrer-Policy header to 'same-origin' for html, xml, json and text files";
    t[351] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a-\u043f\u043e\u043b\u0456\u0446\u0435\u0439\u0441\u044c\u043a\u0438\u0439 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0442 \u043d\u0430 \"\u043e\u0434\u043d\u043e\u0440\u0430\u0437\u043e\u0432\u0438\u0439 \u043f\u043e\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f\" \u0434\u043b\u044f HTML, XML, JSON \u0442\u0430 \u0442\u0435\u043a\u0441\u0442\u043e\u0432\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432";
    t[352] = "Inbound";
    t[353] = "\u0432\u0445\u0456\u0434\u043d\u043e";
    t[358] = "Per Minute";
    t[359] = "\u0417\u0430 \u0445\u0432\u0438\u043b\u0438\u043d\u0443";
    t[360] = "Port not set";
    t[361] = "\u041f\u043e\u0440\u0442 \u043d\u0435 \u0437\u0430\u0434\u0430\u043d\u0438\u0439";
    t[368] = "Unique Local Address per Client";
    t[369] = "\u0423\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u0430 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0430 \u0434\u043b\u044f \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u043a\u043b\u0456\u0454\u043d\u0442\u0430";
    t[374] = "Return to Tunnel Configuration";
    t[375] = "\u041f\u043e\u0432\u0435\u0440\u043d\u0443\u0442\u0438\u0441\u044f \u0434\u043e \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0442\u0443\u043d\u0435\u043b\u044e";
    t[378] = "Blinded";
    t[379] = "\u041e\u0441\u043b\u0456\u043f\u043b\u0435\u043d\u0438\u0439";
    t[380] = "Enable SSL";
    t[381] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 SSL";
    t[382] = "Traffic from all clients with this feature enabled will be routed over the same set of tunnels. This will make profiling the tunnels by an adversary more difficult, but will link the clients together.";
    t[383] = "\u0422\u0440\u0430\u0444\u0456\u043a \u0432\u0456\u0434 \u0443\u0441\u0456\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432 \u0456\u0437 \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e\u044e \u0446\u0456\u0454\u044e \u0444\u0443\u043d\u043a\u0446\u0456\u0454\u044e \u0441\u043f\u0440\u044f\u043c\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u043c\u0435\u0442\u044c\u0441\u044f \u0447\u0435\u0440\u0435\u0437 \u043e\u0434\u0438\u043d \u043d\u0430\u0431\u0456\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u0426\u0435 \u0443\u0441\u043a\u043b\u0430\u0434\u043d\u0438\u0442\u044c \u043f\u0440\u043e\u0444\u0456\u043b\u044e\u0432\u0430\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0441\u0443\u043f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a\u043e\u043c, \u0430\u043b\u0435 \u0437\u0432\u2019\u044f\u0436\u0435 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432 \u0440\u0430\u0437\u043e\u043c.";
    t[384] = "This means that only one I2P tunnel is required rather than a separate tunnel per IRC network.";
    t[385] = "\u0426\u0435 \u043e\u0437\u043d\u0430\u0447\u0430\u0454, \u0449\u043e \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u0439 \u043b\u0438\u0448\u0435 \u043e\u0434\u0438\u043d I2P \u0442\u0443\u043d\u0435\u043b\u044c, \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043e\u043a\u0440\u0435\u043c\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0434\u043b\u044f \u043a\u043e\u0436\u043d\u043e\u0457 IRC \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[386] = "higher bandwidth and reliability";
