    t[1135] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a \u0434\u043e\u0437\u0432\u043e\u043b\u0443 \u043d\u0430 \"\u041e\u0442\u0440\u0438\u043c\u0430\u0442\u0438, \u0440\u043e\u0437\u043c\u0456\u0449\u0443\u0432\u0430\u0442\u0438, \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u0438\u0442\u0438\" \u0434\u043b\u044f HTML, XML, JSON \u0442\u0430 \u0442\u0435\u043a\u0441\u0442\u043e\u0432\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432";
    t[1136] = "Client";
    t[1137] = "\u041a\u043b\u0456\u0454\u043d\u0442";
    t[1138] = "The wizard has now collected enough information to create your tunnel.";
    t[1139] = "\u041c\u0430\u0439\u0441\u0442\u0435\u0440 \u043e\u0442\u0440\u0438\u043c\u0430\u0432 \u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0434\u043b\u044f \u0442\u043e\u0433\u043e, \u0449\u043e\u0431 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[1144] = "New Client Configuration";
    t[1145] = "\u041d\u043e\u0432\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0430";
    t[1156] = "Deny User-Agents matching these strings (probably from inproxies)";
    t[1157] = "\u0417\u0430\u0431\u043e\u0440\u043e\u043d\u0438\u0442\u0438 \u0430\u0433\u0435\u043d\u0442\u0430\u043c \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430, \u044f\u043a\u0456 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u044e\u0442\u044c \u0446\u0438\u043c \u0440\u044f\u0434\u043a\u0430\u043c (\u0439\u043c\u043e\u0432\u0456\u0440\u043d\u043e, \u0432\u0456\u0434 inproxies)";
    t[1158] = "Basic tunnel for connecting to a single service inside I2P.";
    t[1159] = "\u0411\u0430\u0437\u043e\u0432\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u043e\u0457 \u0441\u043b\u0443\u0436\u0431\u0438 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P.";
    t[1160] = "Restricted Access List";
    t[1161] = "\u041e\u0431\u043c\u0435\u0436\u0435\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f";
    t[1162] = "Generate new SSL certificate";
    t[1163] = "\u0421\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043d\u043e\u0432\u0438\u0439 \u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442 SSL";
    t[1172] = "Alongside these basic settings, there are a number of advanced options for tunnel configuration.";
    t[1173] = "\u041a\u0440\u0456\u043c \u0446\u0438\u0445 \u043e\u0441\u043d\u043e\u0432\u043d\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u0456\u0441\u043d\u0443\u0454 \u0456 \u043f\u0435\u0432\u043d\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u0434\u043b\u044f \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0442\u0443\u043d\u0435\u043b\u044e.";
    t[1184] = "This is the port that the client tunnel will be accessed from locally.";
    t[1185] = "\u0426\u0435 \u043f\u043e\u0440\u0442, \u0447\u0435\u0440\u0435\u0437 \u044f\u043a\u0438\u0439 \u0431\u0443\u0434\u0435 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0442\u0443\u043d\u0435\u043b\u044e \u0437 \u043b\u043e\u043a\u0430\u043b\u0456.";
    t[1186] = "Require local authorization for this service";
    t[1187] = "\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0430 \u043c\u0456\u0441\u0446\u0435\u0432\u0430 \u0430\u0432\u0442\u043e\u0440\u0438\u0437\u0430\u0446\u0456\u044f \u0434\u043b\u044f \u0446\u0456\u0454\u0457 \u0441\u043b\u0443\u0436\u0431\u0438";
    t[1202] = "Enables direct chat and file transfers, bypassing I2P. Note that this will compromise your anonymity and is not recommended.";
    t[1203] = "\u0414\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043f\u0440\u044f\u043c\u0438\u0439 \u0447\u0430\u0442 \u0456 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0443 \u0444\u0430\u0439\u043b\u0456\u0432, \u043c\u0438\u043d\u0430\u044e\u0447\u0438 I2P.";
    t[1204] = "Do not spoof User-Agent header";
    t[1205] = "\u041d\u0435 \u043f\u0456\u0434\u0440\u043e\u0431\u043b\u044f\u0439\u0442\u0435 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a User-Agent";
    t[1208] = "Remote Credentials";
    t[1209] = "\u0412\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0456 \u043e\u0431\u043b\u0456\u043a\u043e\u0432\u0456 \u0434\u0430\u043d\u0456";
    t[1210] = "Please be sure to select, copy, and paste the entire contents of the appropriate authentication data into the form of your favorite registration site";
    t[1211] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043d\u0435 \u0437\u0430\u0431\u0443\u0434\u044c\u0442\u0435 \u0432\u0438\u0431\u0440\u0430\u0442\u0438, \u0441\u043a\u043e\u043f\u0456\u044e\u0432\u0430\u0442\u0438 \u0456 \u0432\u0441\u0442\u0430\u0432\u0438\u0442\u0438 \u0432\u0435\u0441\u044c \u0432\u043c\u0456\u0441\u0442 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u0445 \u0430\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0439\u043d\u0438\u0445 \u0434\u0430\u043d\u0438\u0445 \u0443 \u0444\u043e\u0440\u043c\u0443 \u0432\u0430\u0448\u043e\u0433\u043e \u0443\u043b\u044e\u0431\u043b\u0435\u043d\u043e\u0433\u043e \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0439\u043d\u043e\u0433\u043e \u0441\u0430\u0439\u0442\u0443";
    t[1212] = "Delay Connect";
    t[1213] = "\u0417\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u0437\u2019\u0454\u0434\u043d\u0430\u043d\u043d\u044f";
    t[1218] = "Website Hostname e.g. mysite.i2p";
    t[1219] = "\u0406\u043c\u2019\u044f \u0445\u043e\u0441\u0442\u0443 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0443, \u043d\u0430\u043f\u0440. mysite.i2p";
    t[1234] = "Do not block Referer header";
    t[1235] = "\u041d\u0435 \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u0442\u0438 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a Referer";
    t[1236] = "Automatically start tunnel when router starts";
    t[1237] = "\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u0438\u0439 \u0437\u0430\u043f\u0443\u0441\u043a \u0442\u0443\u043d\u0435\u043b\u044e \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[1242] = "internal";
    t[1243] = "\u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u0456\u0439";
    t[1244] = "Auto Start Tunnel";
    t[1245] = "\u0422\u0443\u043d\u0435\u043b\u044c \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e\u0433\u043e \u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[1246] = "SSL Outproxies";
    t[1247] = "\u0417\u043e\u0432\u043d\u0456\u0448\u043d\u0456 SSL \u043f\u0440\u043e\u043a\u0441\u0456";
    t[1250] = "HTTPS configuration";
    t[1251] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f HTTPS";
    t[1256] = "Status Messages";
    t[1257] = "\u041f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u043f\u0440\u043e \u0441\u0442\u0430\u043d";
    t[1262] = "Legacy option (deprecated), provided for backward compatibility";
    t[1263] = "\u0417\u0430\u0441\u0442\u0430\u0440\u0456\u043b\u0430 \u043e\u043f\u0446\u0456\u044f (\u0437\u0430\u0441\u0442\u0430\u0440\u0456\u043b\u0430), \u043f\u0435\u0440\u0435\u0434\u0431\u0430\u0447\u0435\u043d\u0430 \u0434\u043b\u044f \u0437\u0432\u043e\u0440\u043e\u0442\u043d\u043e\u0457 \u0441\u0443\u043c\u0456\u0441\u043d\u043e\u0441\u0442\u0456";
    t[1264] = "Total";
    t[1265] = "\u0412\u0441\u044c\u043e\u0433\u043e";
    t[1266] = "I2CP Hostname or IP";
    t[1267] = "\u0406\u043c\u2019\u044f \u0445\u043e\u0441\u0442\u0443 I2CP \u0430\u0431\u043e IP";
    t[1268] = "Standard server";
    t[1269] = "\u0417\u0432\u0438\u0447\u0430\u0439\u043d\u0438\u0439 \u0441\u0435\u0440\u0432\u0435\u0440";
    t[1272] = "IRC client";
    t[1273] = "IRC \u043a\u043b\u0456\u0454\u043d\u0442";
    t[1274] = "Only enable if you are hosting this service on multiple routers";
    t[1275] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c, \u043b\u0438\u0448\u0435 \u044f\u043a\u0449\u043e \u0432\u0438 \u0440\u043e\u0437\u043c\u0456\u0449\u0443\u0454\u0442\u0435 \u0446\u044e \u0441\u043b\u0443\u0436\u0431\u0443 \u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u0445";
    t[1278] = "no anonymity";
    t[1279] = "\u0431\u0435\u0437 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u043e\u0441\u0442\u0456";
    t[1282] = "Streamr server";
    t[1283] = "Streamr \u0441\u0435\u0440\u0432\u0435\u0440";
    t[1292] = "Each IRC network in I2P that you wish to connect to will require its own tunnel. (See Also, SOCKS IRC)";
    t[1293] = "\u041a\u043e\u0436\u043d\u0430 IRC \u043c\u0435\u0440\u0435\u0436\u0430 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P, \u0434\u043e \u044f\u043a\u043e\u0457 \u0432\u0438 \u0431 \u0445\u043e\u0442\u0456\u043b\u0438 \u0437\u2019\u0454\u0434\u043d\u0430\u0442\u0438\u0441\u044c, \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0454 \u043e\u043a\u0440\u0435\u043c\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e. (\u0414\u0438\u0432. \u0442\u0430\u043a\u043e\u0436 SOCKS IRC)";
    t[1296] = "Enable Direct Client-to-Client protocol";
    t[1297] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u043f\u0440\u044f\u043c\u0438\u0439 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b \u043a\u043b\u0456\u0454\u043d\u0442-\u043a\u043b\u0456\u0454\u043d\u0442";
    t[1302] = "A tunnel that implements the SOCKS protocol.";
    t[1303] = "\u0422\u0443\u043d\u0435\u043b\u044c, \u044f\u043a\u0438\u0439 \u0440\u0435\u0430\u043b\u0456\u0437\u0443\u0454 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b SOCKS.";
    t[1304] = "Referrer-Policy";
    t[1305] = "Referrer-Policy";
    t[1310] = "Send key and password to all users.";
    t[1311] = "\u041d\u0430\u0434\u0456\u0441\u043b\u0430\u0442\u0438 \u043a\u043b\u044e\u0447 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0443\u0441\u0456\u043c \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430\u043c.";
    t[1318] = "I2P Tunnel Manager - Tunnel Creation Wizard";
    t[1319] = "I2P \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 - \u041c\u0430\u0439\u0441\u0442\u0435\u0440 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[1320] = "If a client exceeds the maximum number of post requests per allocated period, enforce a ban for this number of minutes";
    t[1321] = "\u042f\u043a\u0449\u043e \u043a\u043b\u0456\u0454\u043d\u0442 \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u043d\u0430 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u0437\u0430 \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u0438\u0439 \u043f\u0435\u0440\u0456\u043e\u0434, \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u0442\u0438 \u0431\u0430\u043d \u043d\u0430 \u0446\u044e \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0445\u0432\u0438\u043b\u0438\u043d";
    t[1324] = "Allow SSL to I2P addresses when enabled";
    t[1325] = "\u0414\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 SSL \u0434\u043b\u044f \u0430\u0434\u0440\u0435\u0441 I2P, \u043a\u043e\u043b\u0438 \u0432\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e";
    t[1326] = "Incoming I2P Port Routing";
    t[1327] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u044f \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u043f\u043e\u0440\u0442\u0443 I2P";
    t[1330] = "Website Hostname";
    t[1331] = "\u041d\u0430\u0437\u0432\u0430 \u0445\u043e\u0441\u0442\u0443 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0443";
    t[1332] = "medium redundancy, medium resource usage";
    t[1333] = "\u0441\u0435\u0440\u0435\u0434\u043d\u0454 \u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0432\u0430\u043d\u043d\u044f, \u0441\u0435\u0440\u0435\u0434\u043d\u0454 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0440\u0435\u0441\u0443\u0440\u0441\u0456\u0432";
    t[1336] = "Username";
    t[1337] = "\u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430";
    t[1340] = "Specify the port the server is running on";
    t[1341] = "\u0412\u043a\u0430\u0436\u0456\u0442\u044c \u043f\u043e\u0440\u0442, \u043d\u0430 \u044f\u043a\u043e\u043c\u0443 \u043f\u0440\u0430\u0446\u044e\u0454 \u0441\u0435\u0440\u0432\u0435\u0440";
    t[1342] = "Absolute path to Private Key File (will be created if it does not exist)";
    t[1343] = "\u0410\u0431\u0441\u043e\u043b\u044e\u0442\u043d\u0438\u0439 \u0448\u043b\u044f\u0445 \u0434\u043e \u0444\u0430\u0439\u043b\u0443 \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430 (\u0431\u0443\u0434\u0435 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043e, \u044f\u043a\u0449\u043e \u0432\u0456\u043d \u043d\u0435 \u0456\u0441\u043d\u0443\u0454)";
    t[1348] = "Local destination is not available. Start the tunnel.";
    t[1349] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0430. \u0417\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[1352] = "definitely not recommended";
