    t[1376] = "Blinded with lookup password";
    t[1377] = "\u0417\u0430\u043a\u0440\u0438\u0442\u043e \u043f\u043e\u0448\u0443\u043a\u043e\u0432\u0438\u043c \u043f\u0430\u0440\u043e\u043b\u0435\u043c";
