    t[1401] = "\u0411\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0442\u0438\u0445, \u0449\u043e \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u0440\u0435\u0444\u0435\u0440\u0438";
    t[1404] = "Finish Wizard and review tunnel settings";
    t[1405] = "\u0417\u0430\u0432\u0435\u0440\u0448\u0438\u0442\u0438 \u0440\u043e\u0431\u043e\u0442\u0443 \u043c\u0430\u0439\u0441\u0442\u0440\u0430 \u0442\u0430 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u044e";
    t[1408] = "Only allow listed clients to connect to this service";
    t[1409] = "\u0414\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u043b\u0438\u0448\u0435 \u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c \u0437\u0456 \u0441\u043f\u0438\u0441\u043a\u0443 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u0446\u0456\u0454\u0457 \u0441\u043b\u0443\u0436\u0431\u0438";
    t[1410] = "The wizard will set reasonably sensible default values for these, but you can view and/or edit these by clicking on the tunnel's name in the main I2PTunnel page.";
    t[1411] = "\u041c\u0430\u0439\u0441\u0442\u0435\u0440 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0440\u043e\u0437\u0443\u043c\u043d\u0456 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u0430\u043b\u0435 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0457\u0445 \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u043d\u0430\u0442\u0438\u0441\u043d\u0443\u0432\u0448\u0438 \u043d\u0430 \u043d\u0430\u0437\u0432\u0443 \u0442\u0443\u043d\u0435\u043b\u044e \u043d\u0430 \u0433\u043e\u043b\u043e\u0432\u043d\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 I2P.";
    t[1414] = "Enable Cache-Control headers (no-cache for html, xml, json and text, immutable for everything else)";
    t[1415] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0438 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044e \u043a\u0435\u0448\u0443 (\u0431\u0435\u0437 \u043a\u0435\u0448 \u0434\u043b\u044f HTML, XML, JSON \u0442\u0430 \u0442\u0435\u043a\u0441\u0442\u0443, \u043d\u0435\u0437\u043c\u0456\u043d\u043d\u0438\u0439 \u0434\u043b\u044f \u0432\u0441\u044c\u043e\u0433\u043e \u0456\u043d\u0448\u043e\u0433\u043e)";
    t[1424] = "Alternate private key file";
    t[1425] = "\u0410\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0438\u0439 \u0444\u0430\u0439\u043b \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430";
    t[1430] = "See above for required items.";
    t[1431] = "\u0414\u0438\u0432. \u0432\u0438\u0449\u0435 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0456 \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u0438.";
    t[1432] = "Conserve resources by only creating tunnels when required";
    t[1433] = "\u0417\u0431\u0435\u0440\u0456\u0433\u0430\u0439\u0442\u0435 \u0440\u0435\u0441\u0443\u0440\u0441\u0438, \u0441\u0442\u0432\u043e\u0440\u044e\u044e\u0447\u0438 \u0442\u0443\u043d\u0435\u043b\u0456 \u043b\u0438\u0448\u0435 \u0437\u0430 \u043f\u043e\u0442\u0440\u0435\u0431\u0438";
    t[1438] = "IRC server";
    t[1439] = "IRC \u0441\u0435\u0440\u0432\u0435\u0440";
    t[1440] = "Advance to next page";
    t[1441] = "\u041f\u0435\u0440\u0435\u0439\u0442\u0438 \u0434\u043e \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u043e\u0457 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438";
    t[1444] = "Tunnel must be stopped first";
    t[1445] = "\u0421\u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0437\u0443\u043f\u0438\u043d\u0438\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[1452] = "Alternate";
    t[1453] = "\u0410\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0438\u0439";
    t[1458] = "Destination signing key is offline. Use CLI tools on the offline machine.";
    t[1459] = "\u0426\u0456\u043b\u044c\u043e\u0432\u0438\u0439 \u043a\u043b\u044e\u0447 \u043f\u0456\u0434\u043f\u0438\u0441\u0443 \u043e\u0444\u043b\u0430\u0439\u043d. \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u0456\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0438 CLI \u043d\u0430 \u043e\u0444\u043b\u0430\u0439\u043d-\u043c\u0430\u0448\u0438\u043d\u0456.";
    t[1460] = "Password";
    t[1461] = "\u041f\u0430\u0440\u043e\u043b\u044c";
