    t[1467] = "\u0426\u0435\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u043c\u0430\u0454 \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0437 \u043d\u043e\u0432\u0438\u043c \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f\u043c.";
    t[1470] = "Are you sure you want to delete?";
    t[1471] = "\u0412\u0438 \u0432\u043f\u0435\u0432\u043d\u0435\u043d\u0456, \u0449\u043e \u0445\u043e\u0447\u0435\u0442\u0435 \u0432\u0438\u0434\u0430\u043b\u0438\u0442\u0438?";
    t[1476] = "Enter a b64 or .i2p address here";
    t[1477] = "\u0412\u0432\u0435\u0434\u0456\u0442\u044c \u0442\u0443\u0442 \u0430\u0434\u0440\u0435\u0441\u0443 b64 \u0430\u0431\u043e .i2p";
    t[1490] = "Note: When this client is configured to share tunnels, these options apply to all clients configured to share tunnels.";
    t[1491] = "\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430: \u044f\u043a\u0449\u043e \u0446\u0435\u0439 \u043a\u043b\u0456\u0454\u043d\u0442 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0446\u0456 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u0437\u0430\u0441\u0442\u043e\u0441\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043e \u0432\u0441\u0456\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0445 \u043d\u0430 \u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
    t[1502] = "Reachable by";
    t[1503] = "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e \u0446\u0438\u043c";
    t[1508] = "Customised client tunnel specific for IRC connections.";
    t[1509] = "\u0421\u043f\u0435\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u0439 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0434\u043b\u044f IRC \u0437\u2019\u0454\u0434\u043d\u0430\u043d\u044c.";
    t[1514] = "With this tunnel type, IRC networks in I2P can be reached by typing the I2P address into your IRC client, and configuring the IRC client to use this SOCKS tunnel.";
    t[1515] = "\u0417 \u0446\u0438\u043c \u0442\u0438\u043f\u043e\u043c \u0442\u0443\u043d\u0435\u043b\u044c IRC \u043c\u0435\u0440\u0435\u0436\u0456 \u0432 I2P \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u044f\u0436\u043d\u0456 \u0448\u043b\u044f\u0445\u043e\u043c \u0432\u0432\u0435\u0434\u0435\u043d\u043d\u044f I2P-\u0430\u0434\u0440\u0435\u0441\u0438 \u0432 IRC \u043a\u043b\u0456\u0454\u043d\u0442\u0456 \u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u0456 \u0439\u043e\u0433\u043e \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e SOCKS.";
    t[1520] = "When enabled, the accept headers (mime types support) broadcast by your web browser will not be filtered, potentially reducing your anonymity";
    t[1521] = "\u042f\u043a\u0449\u043e \u0432\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e, \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0438 \u043f\u0440\u0438\u0439\u043c\u0430\u043d\u043d\u044f (\u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0430 \u0442\u0438\u043f\u0456\u0432 MIME), \u044f\u043a\u0456 \u0442\u0440\u0430\u043d\u0441\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0432\u0430\u0448\u0438\u043c \u0432\u0435\u0431-\u0431\u0440\u0430\u0443\u0437\u0435\u0440\u043e\u043c, \u043d\u0435 \u0444\u0456\u043b\u044c\u0442\u0440\u0443\u0432\u0430\u0442\u0438\u043c\u0443\u0442\u044c\u0441\u044f, \u0449\u043e \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u043e \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u044c \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c";
    t[1532] = "When enabled, the referer (originating page) of your web requests will not be filtered, potentially reducing your anonymity";
    t[1533] = "\u042f\u043a\u0449\u043e \u0432\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e, \u0440\u0435\u0444\u0435\u0440\u0435\u0440 (\u043e\u0440\u0438\u0433\u0456\u043d\u0430\u043b\u044c\u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430) \u0432\u0430\u0448\u0438\u0445 \u0432\u0435\u0431-\u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u043d\u0435 \u0444\u0456\u043b\u044c\u0442\u0440\u0443\u0432\u0430\u0442\u0438\u043c\u0435\u0442\u044c\u0441\u044f, \u0449\u043e \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u043e \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u044c \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c";
    t[1534] = "I2P Client Tunnels";
    t[1535] = "\u041a\u043b\u0456\u0454\u043d\u0442\u0441\u043a\u0456 I2P \u0442\u0443\u043d\u0435\u043b\u0456";
    t[1536] = "(leave blank for outproxies)";
    t[1537] = "(\u0437\u0430\u043b\u0438\u0448\u0438\u0442\u0438 \u043f\u0443\u0441\u0442\u0438\u043c \u0434\u043b\u044f outproxy)";
    t[1540] = "New server tunnel";
    t[1541] = "\u041d\u043e\u0432\u0438\u0439 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[1542] = "Registration Helper";
    t[1543] = "\u0420\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0439\u043d\u0438\u0439 \u043f\u043e\u043c\u0456\u0447\u043d\u0438\u043a";
    t[1544] = "Keyring Manager";
    t[1545] = "\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u043a\u043b\u044e\u0447\u0456\u0432";
    t[1550] = "Destination";
    t[1551] = "\u0410\u0434\u0440\u0435\u0441\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[1554] = "1 hop tunnel (low anonymity)";
    t[1555] = "\u0422\u0443\u043d\u0435\u043b\u044c \u0437 1 \u0441\u0442\u0440\u0438\u0431\u043a\u043e\u043c (\u043d\u0438\u0437\u044c\u043a\u0430 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c)";
    t[1570] = "Cannot configure, no Jetty server found in {0}client configurations{1} that matches this tunnel";
    t[1571] = "\u041d\u0435 \u0432\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438, \u0443 {0}\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0430{1} \u043d\u0435 \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430 Jetty, \u044f\u043a\u0438\u0439 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0454 \u0446\u044c\u043e\u043c\u0443 \u0442\u0443\u043d\u0435\u043b\u044e";
    t[1572] = "This enables both TCP and UDP connections to be made through a SOCKS outproxy within I2P.";
