    t[1823] = "\u0440\u043e\u0437\u0434\u0456\u043b\u0435\u043d\u0456 \u043a\u043e\u043c\u0430\u043c\u0438, \u043d\u0430\u043f\u0440. Mozilla,Opera (\u0437 \u0443\u0440\u0430\u0445\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0440\u0435\u0433\u0456\u0441\u0442\u0440\u0443)";
    t[1824] = "Reduce tunnels to conserve resources";
    t[1825] = "\u0417\u043c\u0435\u043d\u0448\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456, \u0449\u043e\u0431 \u0437\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0440\u0435\u0441\u0443\u0440\u0441\u0438";
    t[1832] = "Private key file for old destination / sub-domain parent";
    t[1833] = "\u0424\u0430\u0439\u043b \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430 \u0434\u043b\u044f \u0441\u0442\u0430\u0440\u043e\u0433\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f/\u0431\u0430\u0442\u044c\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u0443\u0431\u0434\u043e\u043c\u0435\u043d\u0443";
    t[1834] = "{0} backup tunnel";
    t[1835] = new java.lang.String[] { "{0} \u0440\u0435\u0437\u0435\u0440\u0432\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c", "{0} \u0440\u0435\u0437\u0435\u0440\u0432\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432", "{0} \u0440\u0435\u0437\u0435\u0440\u0432\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432" };
    t[1836] = "Note: In order to enable QR code generation or registration authentication, configure the Website Hostname field (for websites) or the Name field (everything else) above with an .i2p suffixed hostname e.g. mynewserver.i2p";
    t[1837] = "\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430: \u0449\u043e\u0431 \u0443\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0435\u043d\u0435\u0440\u0430\u0446\u0456\u044e QR-\u043a\u043e\u0434\u0443 \u0430\u0431\u043e \u0430\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u044e \u043f\u0440\u0438 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457, \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u043f\u043e\u043b\u0435 \u00ab\u0406\u043c\u2019\u044f \u0445\u043e\u0441\u0442\u0443 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0443\u00bb (\u0434\u043b\u044f \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0456\u0432) \u0430\u0431\u043e \u043f\u043e\u043b\u0435 \u00ab\u0406\u043c\u2019\u044f\u00bb (\u0432\u0441\u0435 \u0456\u043d\u0448\u0435) \u0432\u0438\u0449\u0435 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u0456\u043c\u0435\u043d\u0456 \u0445\u043e\u0441\u0442\u0430 \u0437 \u0441\u0443\u0444\u0456\u043a\u0441\u043e\u043c .i2p, \u043d\u0430\u043f\u0440. mynewserver.i2p";
    t[1838] = "Standby";
    t[1839] = "\u0420\u0435\u0436\u0438\u043c \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f";
    t[1840] = "Set password required to access this service";
    t[1841] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u043f\u0430\u0440\u043e\u043b\u044c \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u0446\u0456\u0454\u0457 \u0441\u043b\u0443\u0436\u0431\u0438";
    t[1842] = "Hostname or IP address of the target server";
    t[1843] = "\u0406\u043c'\u044f \u0445\u043e\u0441\u0442\u0430 \u0430\u0431\u043e IP-\u0430\u0434\u0440\u0435\u0441\u0430 \u0446\u0456\u043b\u044c\u043e\u0432\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430";
    t[1846] = "Description of tunnel to be displayed on Tunnel Manager home page";
    t[1847] = "\u041e\u043f\u0438\u0441 \u0442\u0443\u043d\u0435\u043b\u044e \u0434\u043b\u044f \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u043d\u0430 \u0434\u043e\u043c\u0430\u0448\u043d\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 Tunnel Manager";
    t[1854] = "Stop this Tunnel";
    t[1855] = "\u0417\u0443\u043f\u0438\u043d\u0456\u0442\u044c \u0446\u0435\u0439 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[1864] = "To conserve resources, close tunnels when not in use";
    t[1865] = "\u0429\u043e\u0431 \u0437\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0440\u0435\u0441\u0443\u0440\u0441\u0438, \u0437\u0430\u043a\u0440\u0438\u0432\u0430\u0439\u0442\u0435 \u0442\u0443\u043d\u0435\u043b\u0456, \u043a\u043e\u043b\u0438 \u0432\u043e\u043d\u0438 \u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f";
