    t[1877] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u0434\u043b\u044f \u0432\u0441\u0456\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043f\u0435\u0440\u0435\u0447\u0438\u0442\u0430\u043d\u0430";
    t[1878] = "Tunnel Filter";
    t[1879] = "\u0422\u0443\u043d\u0435\u043b\u044c\u043d\u0438\u0439 \u0444\u0456\u043b\u044c\u0442\u0440";
    t[1880] = "Outproxies";
    t[1881] = "\u0421\u043f\u0438\u0441\u043e\u043a \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0445 \u043f\u0440\u043e\u043a\u0441\u0456 (Outproxies)";
    t[1884] = "Send individual key to each user.";
    t[1885] = "\u041d\u0430\u0434\u0456\u0441\u043b\u0430\u0442\u0438 \u0456\u043d\u0434\u0438\u0432\u0456\u0434\u0443\u0430\u043b\u044c\u043d\u0438\u0439 \u043a\u043b\u044e\u0447 \u043a\u043e\u0436\u043d\u043e\u043c\u0443 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0435\u0432\u0456.";
    t[1886] = "Name of tunnel to be displayed on Tunnel Manager home page and the router console sidebar";
    t[1887] = "\u041d\u0430\u0437\u0432\u0430 \u0442\u0443\u043d\u0435\u043b\u044e, \u044f\u043a\u0430 \u0431\u0443\u0434\u0435 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438\u0441\u044f \u043d\u0430 \u0434\u043e\u043c\u0430\u0448\u043d\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 Tunnel Manager \u0456 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[1890] = "Generate QR Code";
    t[1891] = "\u0417\u0433\u0435\u043d\u0435\u0440\u0443\u0432\u0430\u0442\u0438 QR-\u043a\u043e\u0434";
    t[1892] = "A customised server tunnel for hosting IRC networks inside I2P.";
    t[1893] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0434\u043b\u044f \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u043d\u044f IRC \u043c\u0435\u0440\u0435\u0436 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P.";
    t[1894] = "There are several types of tunnels to choose from:";
    t[1895] = "\u0404 \u043a\u0456\u043b\u044c\u043a\u0430 \u0442\u0438\u043f\u0456\u0432 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043d\u0430 \u0432\u0438\u0431\u0456\u0440:";
    t[1896] = "lower bandwidth and reliability";
    t[1897] = "\u043d\u0438\u0436\u0447\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c \u0456 \u043d\u0430\u0434\u0456\u0439\u043d\u0456\u0441\u0442\u044c";
    t[1904] = "+/- 0-3 hop variance";
    t[1905] = "/- \u0434\u0438\u0441\u043f\u0435\u0440\u0441\u0456\u044f \u0441\u0442\u0440\u0438\u0431\u043a\u0456\u0432 0-3";
    t[1906] = "Target";
    t[1907] = "\u0426\u0456\u043b\u044c";
    t[1908] = "Global Tunnel Control";
    t[1909] = "\u0413\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u0438\u0439 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[1920] = "Invalid port";
    t[1921] = "\u041d\u0435\u0432\u0456\u0440\u043d\u0438\u0439 \u043f\u043e\u0440\u0442";
    t[1926] = "These can be anything you want - they are just for ease of identifying the tunnel in the routerconsole.";
    t[1927] = "\u0422\u0443\u0442 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0449\u043e \u0437\u0430\u0432\u0433\u043e\u0434\u043d\u043e - \u043f\u0440\u043e\u0441\u0442\u043e \u0434\u043b\u044f \u0437\u0440\u0443\u0447\u043d\u043e\u0441\u0442\u0456 \u0456\u0434\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0457 \u0442\u0443\u043d\u0435\u043b\u044e \u0432 \u043a\u043e\u043d\u0441\u043e\u043b\u0456.";
    t[1930] = "This is the default, recommended option";
    t[1931] = "\u0446\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0439 \u0432\u0430\u0440\u0456\u0430\u043d\u0442 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c";
    t[1932] = "Websites outside I2P can also be reached if an HTTP proxy within I2P is known.";
    t[1933] = "\u0412\u0435\u0431-\u0441\u0430\u0439\u0442\u0438 \u0437\u0430 \u043c\u0435\u0436\u0430\u043c\u0438 I2P \u0442\u0430\u043a\u043e\u0436 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0447\u0435\u0440\u0435\u0437 \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u0432\u0430\u043c HTTP-\u043f\u0440\u043e\u043a\u0441\u0456.";
    t[1938] = "standard bandwidth and reliability";
    t[1939] = "\u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c \u0456 \u043d\u0430\u0434\u0456\u0439\u043d\u0456\u0441\u0442\u044c";
    t[1940] = "To enable registration verification, edit tunnel and set name (or website name) to a valid host name ending in '.i2p'";
    t[1941] = "\u0414\u043b\u044f \u0430\u043a\u0442\u0438\u0432\u0430\u0446\u0456\u0457 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0439\u043d\u043e\u0457 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u0437\u043c\u0456\u043d\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c \u0456 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u043d\u0430\u0437\u0432\u0443 (\u0447\u0438 \u043d\u0430\u0437\u0432\u0443 \u0441\u0430\u0439\u0442\u0443) \u0437 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0438\u043c \u0441\u0443\u0444\u0456\u043a\u0441\u043e\u043c '.i2p'";
    t[1942] = "high randomization, very low performance";
    t[1943] = "\u0432\u0438\u0441\u043e\u043a\u0430 \u0440\u0430\u043d\u0434\u043e\u043c\u0456\u0437\u0430\u0446\u0456\u044f, \u0434\u0443\u0436\u0435 \u043d\u0438\u0437\u044c\u043a\u0430 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0456\u0441\u0442\u044c";
    t[1950] = "If the problem persists, verify that you have cookies enabled in your browser.";
    t[1951] = "\u042f\u043a\u0449\u043e \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430 \u043d\u0435 \u0443\u0441\u0443\u043d\u0443\u0442\u0430, \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u0449\u043e cookies \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0456 \u0443 \u0432\u0430\u0448\u043e\u043c\u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456.";
    t[1954] = "When enabled, the user agent of your web browser or http client will not be spoofed, potentially reducing your anonymity";
    t[1955] = "\u042f\u043a\u0449\u043e \u0432\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e, \u0430\u0433\u0435\u043d\u0442 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0432\u0430\u0448\u043e\u0433\u043e \u0432\u0435\u0431-\u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430 \u0447\u0438 http-\u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u043d\u0435 \u0431\u0443\u0434\u0435 \u043f\u0456\u0434\u0440\u043e\u0431\u043b\u0435\u043d\u043e, \u0449\u043e \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u043e \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u044c \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c";
    t[1956] = "Total number of post requests permitted for the configured timespan";
    t[1957] = "\u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u043d\u0430 \u0434\u043e\u043f\u0438\u0441\u0438, \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u0430 \u0434\u043b\u044f \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u0447\u0430\u0441\u0443";
    t[1970] = "+/- 0-2 hop variance";
    t[1971] = "/- \u0434\u0438\u0441\u043f\u0435\u0440\u0441\u0456\u044f \u0441\u0442\u0440\u0438\u0431\u043a\u0456\u0432 0-2";
