    t[1973] = "\u0417\u0443\u043f\u0438\u043d\u0438\u0442\u0438";
    t[1976] = "Client Key";
    t[1977] = "\u041a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u043a\u043b\u044e\u0447";
    t[1978] = "Server Access Options";
    t[1979] = "\u041f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430";
